import React from 'react'

function Checkout() {
  return (
    <div>
        <div style={{width:"100%", minHeight:"100vh", display:"flex", }}>
            <div style={{width:"55%", height:"100%"}}></div>
            <div style={{width:"45%", backgroundColor:"#F5F5F5", height:"100%"}}></div>
        </div>
    </div>
  )
}

export default Checkout
